import { Component, OnInit } from '@angular/core';
import { AuthService } from 'src/app/core/services/auth.service';
import { Router } from "@angular/router";
import { UIBootstrapService } from 'src/app/core/services/uibootstrap.service';
import { UserManagementService } from "src/app/core/services/user-management.service";
import { AuthGoogleService } from 'src/app/core/services/auth-google.service';



@Component({
  selector: 'app-header',
  templateUrl: './header.component.html',
  styleUrls: ['./header.component.css']
})
export class HeaderComponent implements OnInit {

  isCollapsed = true;
  public user: any = { data: {} };

  constructor(
    private _authService: AuthService,
    private _router: Router,
    private _uiBootstrapService: UIBootstrapService,
    private _userManagementService: UserManagementService,
    private _authGoogleService: AuthGoogleService,
) { }

  ngOnInit(): void {
    this.fetchUserData();

  }

  showData() {
    const data = JSON.stringify(this._authGoogleService.getProfile())
    console.log(data);
  }

  logOut() {
    this._authGoogleService.logout();
    this._router.navigate(['auth/login']);
  }

  fetchUserData() {
    this._userManagementService.getUser().subscribe(
      response => {
        this.user = response;
        this._uiBootstrapService.activateFeatherIcons();
      },
      error => {
        console.error(error);
      }
    );
  }

  logout(): void {
    this._authService.logout();
  }

  accountSetting(): void {
    this._router.navigate(['/profile']);
  }

}
